import React, { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route, } from "react-router-dom";
import './App.css';

import HomePage from './homePage';
import GamesPage from './gamesPage';
import Main from './main';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/videogames" element={<GamesPage />} >
            <Route path=":query" element={<Main />}/>
          </Route>
          <Route path='/videogame' element={<div>singolo gioco</div>}>
            <Route path=":id" element={<p>single</p>}/>
          </Route>
          <Route path='/log-in' element={<div>log in</div>} />
          <Route path='sign-up' element={<div>sign-up</div>} />
        <Route path="*" element={<div>wrong url</div>} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
